import React from 'react'
import './Otp.css'
const Verification = () => {
  const lengthCheck=()=>{
    if(this.value.length===4) 
      return false;
  };
  
  return (
  <>
    <div class="container Verification-cn">
      <header>
        <i class="bx bxs-check-shield"></i>
      </header>
      <h4>Enter OTP Code</h4>
      <form>
        <div class="input-field">
          <input type="number" required size="1" pattern="/^-?\d+\.?\d*$/" onChange={lengthCheck}/>
          <input type="number" required size="1" maxlength="1"/>
          <input type="number" required size="1"/>
          <input type="number" required size="1"/>
        </div>
        <button>Verify OTP</button>
      </form>
    </div>
  </>
  )
}

export default Verification
